import { MinusCircleOutlined, PlusCircleOutlined } from "@ant-design/icons";
import { Button, Input } from "antd";
import React from "react";

function Passenger() {
  return (
    <div
      style={{
        position: "absolute",
        width: "100%",
        zIndex: 9999,
        background: "white",
        textAlign: "left",
        padding: "10px",
      }}
    >
      <div>성인</div>
      <MinusCircleOutlined
        style={{
          width: "36px",
          height: "36px",
          fontSize: "20px",
          lineHeight: "36px",
        }}
      />
      <Input
        style={{ width: "36px", height: "36px", textAlign: "center" }}
        readOnly
      ></Input>
      <PlusCircleOutlined
        style={{
          width: "36px",
          height: "36px",
          fontSize: "20px",
          lineHeight: "36px",
        }}
      />
      <div>유아</div>
    </div>
  );
}

export default Passenger;
